    return (
        <div className='nav'>
            <span>
                <input type='text' placeholder='Search' className='center'></input>
            </span>
            <span className='navList'>
                <p className='navItem'>Account</p>
                <p className='navItem'>Orders</p>
                <p className='navItem'>Shop</p>
                <p>Help</p>
            </span>
            <span>
                <i></i>
                <Link to='cart' className='cart'>Your Cart</Link>
            </span>
        </div>

    )
}

export default Header;
